import { useEffect, useState } from "react"

function FundingRankTableOkx() {
  const [users, setUsers] = useState([])
  const [loading, setLoading] = useState(false)
  useEffect(() => {
    setLoading(true)
    fetch("http://139.59.154.21:8080/fundingRank?cex=okx")
      .then((response) => {
        const responseFromDb = response.json()
        console.log(responseFromDb)
      })
      .then(json => setUsers(json))
      .finally(() => {
        setLoading(false)
      })
  }, [])

  return (
    <div className="FundingRankTable">
      {loading ? (
        <div>Loading...</div>
      ) : (
        <>
          <h1>okx</h1>
          <table border={1}>
            <tr>
              <th>Pair</th>
              <th>Funding</th>
            </tr>
            {users.map(user => (
              <tr key={user.id}>
                <td>{user.pair}</td>
                <td>{user.funding}</td>
              </tr>
            ))}
          </table>
        </>
      )}
    </div>
  )
}

